import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css";
import CartProvider from "./components/store/CartProvider";

ReactDOM.render(
  <CartProvider>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </CartProvider>,
  document.getElementById("root")
);
